// -------------------- Summary builder (deterministic) --------------------
function humanWebsiteType(t) {
    switch(t){
        case "static":
            return "Static / Landing website";
        case "business":
            return "Business website";
        case "ecommerce":
            return "E-commerce website";
        case "booking":
            return "Booking / Appointment website";
        case "portfolio":
            return "Portfolio website";
        case "custom":
            return "Custom website/app";
        default:
            return "Not decided";
    }
}
function humanPlatform(p) {
    switch(p){
        case "code":
            return "Custom-coded (Next.js/React etc.)";
        case "wordpress":
            return "WordPress";
        case "shopify":
            return "Shopify";
        case "not_sure":
            return "Not sure (recommend)";
        default:
            return "Not decided";
    }
}
function buildDeterministicSummary(r) {
    const lines = [];
    lines.push(`*${BOT_NAME} — Website Requirements Summary*`);
    lines.push("");
    lines.push(`1) Client info`);
    lines.push(`- Name: ${r.contact.name || "-"}`);
    lines.push(`- Phone: ${r.contact.phone || "-"}`);
    lines.push(`- Email: ${r.contact.email || "-"}`);
    lines.push(`- City: ${r.contact.city || "-"}`);
    lines.push("");
    lines.push(`2) Project basics`);
    lines.push(`- Website type: ${humanWebsiteType(r.websiteType)}`);
    lines.push(`- Build platform: ${humanPlatform(r.platform)}`);
    lines.push(`- Business name: ${r.businessName || "-"}`);
    lines.push(`- Industry: ${r.businessIndustry || "-"}`);
    lines.push(`- Target audience: ${r.targetAudience || "-"}`);
    if (r.referenceWebsites.trim()) lines.push(`- Reference websites: ${r.referenceWebsites.trim()}`);
    lines.push("");
    lines.push(`3) Pages & content`);
    lines.push(`- Pages count (approx): ${r.pages.pagesCountApprox || "-"}`);
    lines.push(`- Pages needed: ${r.pages.pagesNeeded || "-"}`);
    lines.push(`- Blog: ${r.pages.blogNeeded === null ? "-" : r.pages.blogNeeded ? "Yes" : "No"}`);
    lines.push(`- CMS: ${r.pages.cmsNeeded === null ? "-" : r.pages.cmsNeeded ? "Yes" : "No"}`);
    lines.push(`- Content provided by: ${r.pages.contentOwner || "-"}`);
    lines.push(`- Logo available: ${r.pages.hasLogo === null ? "-" : r.pages.hasLogo ? "Yes" : "No"}`);
    lines.push(`- Brand colors available: ${r.pages.hasBrandColors === null ? "-" : r.pages.hasBrandColors ? "Yes" : "No"}`);
    lines.push("");
    lines.push(`4) Design preferences`);
    lines.push(`- Style: ${r.design.style}`);
    lines.push(`- Colors: ${r.design.colorPreferences || "-"}`);
    lines.push(`- Animations: ${r.design.animations}`);
    lines.push("");
    lines.push(`5) Features`);
    lines.push(`- Selected: ${r.features.length ? r.features.join(", ") : "-"}`);
    if (r.ai.structuredNotes.length) {
        lines.push(`- Structured notes:`);
        for (const n of r.ai.structuredNotes.slice(0, 10))lines.push(`  - ${n}`);
    }
    lines.push("");
    if (r.websiteType === "ecommerce") {
        lines.push(`6) E-commerce specifics`);
        lines.push(`- Physical products: ${r.ecommerce.sellPhysical === null ? "-" : r.ecommerce.sellPhysical ? "Yes" : "No"}`);
        lines.push(`- Digital products: ${r.ecommerce.sellDigital === null ? "-" : r.ecommerce.sellDigital ? "Yes" : "No"}`);
        lines.push(`- Products count (approx): ${r.ecommerce.productsCountApprox || "-"}`);
        lines.push(`- Admin panel: ${r.ecommerce.adminPanel === null ? "-" : r.ecommerce.adminPanel ? "Yes" : "No"}`);
        lines.push(`- Payment gateway: ${r.ecommerce.paymentGateway === null ? "-" : r.ecommerce.paymentGateway ? "Yes" : "No"}`);
        if (r.ecommerce.paymentProviders.length) {
            lines.push(`- Payment providers: ${r.ecommerce.paymentProviders.join(", ")}`);
        }
        lines.push(`- COD: ${r.ecommerce.codEnabled === null ? "-" : r.ecommerce.codEnabled ? "Yes" : "No"}`);
        lines.push(`- WhatsApp add-to-cart: ${r.ecommerce.whatsappCart === null ? "-" : r.ecommerce.whatsappCart ? "Yes" : "No"}`);
        if (r.ecommerce.whatsappCart) {
            lines.push(`- WhatsApp number: ${r.ecommerce.whatsappNumber || "-"}`);
            lines.push(`- WhatsApp message preference: ${r.ecommerce.whatsappCartMessagePreference}`);
        }
        lines.push(`- Shipping integration: ${r.ecommerce.shippingIntegration === null ? "-" : r.ecommerce.shippingIntegration ? "Yes" : "No"}`);
        if (r.ecommerce.shippingIntegration && r.ecommerce.shippingProvider.trim()) {
            lines.push(`- Shipping provider: ${r.ecommerce.shippingProvider.trim()}`);
        }
        lines.push(`- GST invoices: ${r.ecommerce.gstInvoices === null ? "-" : r.ecommerce.gstInvoices ? "Yes" : "No"}`);
        lines.push("");
    }
    lines.push(`7) Integrations`);
    lines.push(`- Domain: ${r.integrations.domain}`);
    lines.push(`- Hosting: ${r.integrations.hosting || "-"}`);
    lines.push(`- Business email: ${r.integrations.email}`);
    lines.push(`- Analytics setup: ${r.integrations.analytics === null ? "-" : r.integrations.analytics ? "Yes" : "No"}`);
    lines.push(`- SEO setup: ${r.integrations.seoSetup === null ? "-" : r.integrations.seoSetup ? "Yes" : "No"}`);
    lines.push(`- CRM: ${r.integrations.crm}${r.integrations.crm === "other" ? ` (${r.integrations.crmOther || "-"})` : ""}`);
    lines.push("");
    lines.push(`8) Timeline & budget`);
    lines.push(`- Timeline: ${r.plan.timeline || "-"}`);
    lines.push(`- Budget: ${r.plan.budget || "-"}`);
    lines.push(`- Support: ${r.plan.support}`);
    lines.push("");
    if (r.notesOther.trim()) {
        lines.push(`9) Other notes`);
        lines.push(r.notesOther.trim());
        lines.push("");
    }
    lines.push("Please share a quote & next steps.");
    return normalizeWhitespace(lines.join("\n"));
}
